// ==UserScript==
// @name         oldglogo
// @namespace    https://github.com/zulc22
// @version      0.3
// @description  Revert the Google Logo to an earlier incarnation
// @author       zulc22
// @match        https://www.google.com/*
// @icon         data:image/vnd.microsoft.icon;base64,
// @grant        none
// @run-at       document-start
// @updateURL    https://github.com/zulc22/oldglogo/raw/master/oldglogo.user.js
// @downloadURL  https://github.com/zulc22/oldglogo/raw/master/oldglogo.user.js
// @homepageURL  https://github.com/zulc22/oldglogo
// ==/UserScript==

function replaceLogo(e) {
    e.src = logoData;
    e.removeAttribute("srcset")
    e.removeAttribute("width")
    e.style.visibility = 'hidden'
    e.onload = () => { e.style.visibility = 'visible' }
}

function changeFavicon(faviconurl) {
    var link = document.querySelector("link[rel~='icon']");
    if (!link) {
        link = document.createElement('link');
        link.rel = 'icon';
        document.getElementsByTagName('head')[0].appendChild(link);
    }
    link.href = faviconurl;
}

function main() {
    // Replace favicon
    changeFavicon(faviconData)
    // Replace logo
    var e
    // On front page
    if (window.location.href == "https://www.google.com/"||
        window.location.href.startsWith("https://www.google.com/webhp")) {
        e = document.getElementById("hplogo")
        e.innerHTML = `<img src="${logoData}" height=110px>`
        e.parentElement.style.height = "115px"
        e.parentElement.parentElement.style.height = "115px"
        e.parentElement.parentElement.style.marginTop = "5%"
    }
    // On search page
    if (window.location.href.startsWith("https://www.google.com/search")) {
        var tbm = window.location.href.split("&").filter(i=>i.startsWith("tbm"));
        if (tbm && tbm[0]=="tbm=isch") {
            // Image search page (doesn't have div.logo for some reason)
            e = document.getElementsByTagName("img")[0]
        } else {
            // Replace first image in div.logo
            e = document.getElementsByClassName("logo")[0].getElementsByTagName("img")[0]
        }
        replaceLogo(e)
        e.style = "width: auto !important"
    }
}

// Data URIs of assets (because archive.org is slow as all hell)
// Transparent logo taken from 2008, used the Color To Alpha filter in GIMP
// Favicon from 2010

let logoData="data:image/png;base64,"
let faviconData="data:image/vnd.microsoft.icon;base64,"
main()